import React from "react";
import {
  Nav,
  NavLink,
  DropdownLink,
  DropDownContent,
  NavMenu,
  Logo,
} from "./NavbarStyle";
import { useAuth0 } from "@auth0/auth0-react";
import marview_logo from "../../imgs/marview_logo.png";

function Navbar() {
  const { user, isAuthenticated, loginWithRedirect, logout } = useAuth0();

  const logoutWithRedirect = () =>
    logout({ logoutParams: { returnTo: window.location.origin } });

  return (
    <Nav>
      <Logo to="/" activeStyle content={marview_logo} />
      <NavMenu>
        <NavLink to="/about" activeStyle>
          ABOUT
        </NavLink>
        <DropdownLink to="/product" activeStyle>
          PRODUCT
        </DropdownLink>
        <DropDownContent>
          <NavLink to="/product/link1" activeStyle>
            Link 1
          </NavLink>
        </DropDownContent>
        <NavLink to="/roadmap" activeStyle>
          ROADMAP
        </NavLink>
        <NavLink to="/contact" activeStyle>
          CONTACT
        </NavLink>
        <NavLink to="/profile" activeStyle>
          PROFILE
        </NavLink>
      </NavMenu>
    </Nav>
  );
}

export default Navbar;
